import React from 'react';
import { Link } from "react-router-dom";
import PrettyNav from './navStyles';
import { connect } from 'react-redux';


class Nav extends React.Component {
    displayProfile = () => {
        if (this.props.username !== '') {
            return (
                <div>
                    <Link to='/profile'>{this.props.username}sup</Link>
                    <Link to='/login'>Login</Link>
                <Link to='/signup'>Signup</Link>
                    <h2>ayo</h2>
                </div>
            )
        } else if (this.props.username === '') {
            return <Link to='/profile'>{this.props.username}nothing</Link>
        }
        // return <Link to='/profile'>{this.props.username}sup</Link>
        // return <Link to='/profile'>{this.props.username ? this.props.username + "'s Profile" : this.props.username}</Link>
    }

    render() {
        return (
            <PrettyNav>
                <Link className='logo' to='/'>Thread Auction</Link>
                <Link to='/create-auction'>Create Auction</Link>
                {this.displayProfile()}
            </PrettyNav>
        )
    }
}

function mapStateToProps(state) {
    console.log('Product: mapStateToProps state',state);
    return {
      username: state.username,
      password: state.password,
      isLoggedIn: true
    };
}

export default connect(mapStateToProps)(Nav);
